import Layout from "../components/Layout";

const Search = (props) => {
  return (
    <Layout>
      당신이 검색한 키워드는 "{props.url.query.keyword}"입니다.
      <button
        onClick={() => {
          props.url.push("./");
        }}
      ></button>
    </Layout>
  );
};

export default Search;
